import React, { useEffect, useState } from "react"
import ReactDOM from "react-dom/client";

const UseWeatherApi = () => {
    const [weather, setWeather] = useState([])
    const [current, setCurrent] = useState([])
    let fetchWeather = () => {
        fetch("https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/melbourne?unitGroup=metric&include=current&key=JB7CB9FV8WLE3SE7N3AYLFWT9&contentType=json", {
            "method": "GET",
            "headers": {
                'Content-Type': 'application/json'
            }
            })
        .then(response => {
            return response.json()
        })
        .then(data => {
            setWeather(data);
            setCurrent(data.currentConditions);
        })
        .catch(error => console.log(error));
    }

    useEffect(() => {
        fetchWeather()
    }, [])
    console.log(weather)
    console.log(weather.currentConditions)
    return(
        <div>
        <p>{weather.resolvedAddress}</p>
       <p>{current.temp}</p>
      </div>
    )
}


export default UseWeatherApi
